def calculate_minimum_health(T, test_cases):

    def primes_sieve1(limit):
        limitn = limit - 1
        primes = dict()
        for i in range(2, limitn):
            primes[i] = True
        for i in primes:
            factors = list(range(i, limitn, i))
            for f in factors[1:]:
                primes[f] = False
        return [i for i in primes if primes[i] == True]
    primes = primes_sieve1(130)

    def smartDivisorGenerator(n):
        limit = 1
        for val in primes:
            counter = 1
            while True:
                if n % val == 0:
                    counter += 1
                    n = n / val
                else:
                    break
            limit = limit * counter
        return limit
    results = []
    for case in test_cases:
        (a, b) = case
        max_divisors = 0
        guarded_floors = 0
        for val in range(a, b + 1):
            div = smartDivisorGenerator(val)
            if div > max_divisors:
                guarded_floors = 0
                max_divisors = div
                guarded_floors += 1
            elif div == max_divisors:
                guarded_floors += 1
        results.append(guarded_floors + 1)
    return results

